import React, { useState } from 'react'
import './Auth.css'
import icon from '../../assets/logo3.png'

const Auth = () => {

  const [isSignup, setIsSignup] = useState(false)

  return (
    <section class="auth-section">
        <div class="auth-container">
          {!isSignup && <img src={icon} alt="stack-overflow" className="login-logo" width="250px"/>}
          <form action="">
            <label htmlFor="">
              Email
            </label>
            <input type="text" />
          </form>
        </div>
    </section>
  )
}

export default Auth


